import React from "react";

function Contact() {
  return (
    <div style={{ padding: "2rem", maxWidth: "600px", margin: "auto", color: "#eee" }}>
      <h2 style={{ color: "#ffd700" }}>Contact Us</h2>
      <p>If you have any questions, feedback, or need help using Editly, feel free to reach out.</p>
      <p>Email: <a href="mailto:safeeditpdf@gmail.com" style={{ color: "#00bfff" }}>safeeditpdf@gmail.com</a></p>
    </div>
  );
}

export default Contact;
